    "    \"色彩体系\": \"色彩体系以柔和的背景色和明亮的强调色为特点。\\n- **背景色**: 采用大面积的**梦幻渐变色**，由左上角的**淡薰衣草紫**、右下角的**天空蓝**和中间过渡的**樱花粉**无缝融合，营造出柔和、空灵的背景氛围。\\n- **主色调 (UI面板)**: 使用**半透明磨砂白**作为所有卡片的背景色，形成了核心的“毛玻璃”质感，与彩色背景产生漂亮的层次分离。\\n- **强调色**: **电光紫**作为核心强调色，用于最重要的按钮、图表数据、进度条和插画的关键部分，非常醒目，赋予了界面活力。\\n- **辅助色盘**: 一组和谐的**马卡龙色系**，包括**薄荷绿**、**天空蓝**、**杏仁橙**和**柠檬黄**，用于图表、标签和图标中，区分不同数据类别，增添了页面的友好度和视觉趣味性。\\n- **文字色**: 主要使用**深炭灰色**作为正文和标题，保证了在半透明背景下的可读性。次要信息和标签则使用**中性浅灰色**。\",\n" +
    "    \"设计风格\": \"该UI设计是典型的**毛玻璃风格 (Glassmorphism)**。其核心特征体现在：\\n1.  **透明度和模糊**: 所有卡片和导航栏都具有背景模糊的半透明效果，能隐约透出后方的渐变色背景。\\n2.  **多层级感**: 通过模糊、阴影和不同透明度的元素叠加，创造出清晰的前后空间关系，仿佛元素“浮”在空中。\\n3.  **微妙的边框**: 每个毛玻璃元素都有一圈极细的1像素亮白色边框，用以模拟玻璃的边缘反光，增强了元素的轮廓感。\\n4.  **圆角和间距**: 大量的圆角矩形和充足的留白间距，使得整体布局显得干净、有序且不拥挤。\\n5.  **插画风格**: 采用了线条简洁、色彩鲜明的扁平化矢量插画，风格现代、风趣，为专业的数据仪表盘增添了人文气息。\"\n" +
    "  }\n" +
    "}";


